function plusSlides(n){showSlides(slideIndex+=n)}function currentSlide(n){showSlides(slideIndex=n)}function showSlides(n){var t,i=document.getElementsByClassName("mySlides"),r=document.getElementsByClassName("dot");for(n>i.length&&(slideIndex=1),n<1&&(slideIndex=i.length),t=0;t<i.length;t++)i[t].style.display="none";for(t=0;t<r.length;t++)r[t].className=r[t].className.replace(" active","");i[slideIndex-1].style.display="block";r[slideIndex-1].className+=" active"}function openTab(n){for(var i=document.getElementsByClassName("data"),t=0;t<i.length;t++)i[t].style.display="none";document.getElementById(n).style.display="block"}var slideIndex=1;showSlides(slideIndex);